import * as React from 'react';
import { BarChart } from '@mui/x-charts/BarChart';

export default function SimpleCharts() {
  return (
    <BarChart
      xAxis={[
        {
          id: 'barCategories',
          data: ['Jan', 'Feb', 'Mar','April','May','June','Aug','Sep','Oct','Nov','Dec'],
          scaleType: 'band',
        },
      ]}
      series={[
        {
          data: [0,0,0,0,0,0,0,],
        },
      ]}
      width={700}
      height={1000}
    />
  );
}
